import { all, call} from 'redux-saga/effects';
import { onFetchCollectionsStart } from './shop/shop';
import { userSagas } from './user/user';
import { cartSagas } from './cart/cart';

export default function* rootSaga(){
  yield all([
    call(onFetchCollectionsStart),
    call(userSagas),
    call(cartSagas)
  ])
}
